INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 7, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 7, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 7, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 10, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 10, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 10, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 10, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -416.5, 12, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 13, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 13, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 13, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 13, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 14, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 14, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 14, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 14, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -470.0, 15, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 16, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 16, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 16, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 16, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 17, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 25, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 25, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 25, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 25, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 190801, 1, -363.0, 18, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, 190801, 1, -363.0, 18, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (3, 190801, 1, -470.0, 19, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (4, 190801, 1, -470.0, 19, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (5, 190801, 1, -470.0, 20, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (6, 190801, 1, -470.0, 20, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 21, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 21, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 21, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 21, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 190801, 1, -430.0, 22, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, 190801, 1, -430.0, 22, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (3, 190801, 1, -430.0, 23, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (4, 190801, 1, -430.0, 23, 0.0, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 109001, 1, -385.0, 24, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.08, 2, 10011, 0, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, 109001, 1, -385.0, 24, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.0, 2, 10011, 0, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (3, 109001, 1, -385.0, 24, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10.11, 2, 10011, 0, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (4, 109001, 1, -385.0, 24, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.0, 2, 10011, 0, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (5, 109001, 1, -385.0, 24, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 6.0, 2, 10011, 0, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (6, 109002, 1, 0.0, 24, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (7, 109002, 1, 0.0, 24, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (8, 109002, 1, 0.0, 24, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (9, 109002, 1, 0.0, 24, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (10, 109002, 1, 0.0, 24, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 109101, 1, -385.0, 24, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 2.12, 2, 10011, 0, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, 109101, 5, -385.0, 24, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.19, 2, 10011, 0, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (3, 109101, 2, -385.0, 24, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 2.3, 4, 10011, 0, 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (4, 109102, 1, 0.0, 24, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (5, 109101, 5, -385.0, 24, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.23, 2, 10011, 0, 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (6, 109102, 1, 0.0, 24, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (7, 109101, 1, -385.0, 24, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.01, 2, 10011, 0, 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (8, 109102, 1, 0.0, 24, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (9, 109102, 1, 0.0, 24, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (10, 109102, 1, 0.0, 24, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 10011, 0, 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 26, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 26, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 26, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105901, 1, -363.0, 26, 0.0, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106401, 2, -363.0, 27, 0.0, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 2104010, 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 105801, 1, -363.0, 27, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 106001, 1, -363.0, 27, 0.0, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
