INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, 123001, 1, -416.5, 44, 0.0, "アメス", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 1, 0, 0, 43005, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (3, 123001, 1, -416.5, 45, 0.0, "アメス", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 5.79, 2, 0, 0, 43006, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
